import {
  SET_SCREAMS,
  LOADING_DATA,
  LIKE_HUM,
  UNLIKE_HUM,
  DELETE_HUM,
} from "../types";
import axios from "axios";

export const getHums = () => (dispatch) => {
  dispatch({ type: LOADING_DATA });
  axios
    .get("/Hums")
    .then((res) => {
      dispatch({
        type: SET_SCREAMS,
        payload: res.data,
      });
    })
    .catch((err) => {
      dispatch({
        type: SET_SCREAMS,
        payload: [],
      });
    });
};

export const likeHum = (humId) => (dispatch) => {
  console.log("like");
  axios
    .get(`/Hum/${humId}/like`)
    .then((res) => {
      dispatch({
        type: LIKE_HUM,
        payload: res.data,
      });
    })
    .catch((err) => console.log(err));
};

export const unlikeHum = (humId) => (dispatch) => {
  console.log("unlike");
  axios
    .get(`/Hum/${humId}/unlike`)
    .then((res) => {
      dispatch({
        type: UNLIKE_HUM,
        payload: res.data,
      });
    })
    .catch((err) => console.log(err));
};

export const deleteHum = (humId) => (dispatch) => {
  axios
    .delete(`/Hum/${humId}`)
    .then(() => {
      dispatch({ type: DELETE_HUM, payload: humId });
    })
    .catch((err) => console.log(err));
};
